    { date: "15-10-2025", score: "78%" },
    { date: "20-10-2025", score: "88%" },
    { date: "25-10-2025", score: "85%" },
    { date: "30-10-2025", score: "90%" },
    { date: "04-11-2025", score: "92%" },
    { date: "09-11-2025", score: "87%" },
    { date: "14-11-2025", score: "89%" },
  ];

  const last5Exams = [
    { day: "Day 1", percentage: 80 },
    { day: "Day 2", percentage: 75 },
    { day: "Day 3", percentage: 82 },
    { day: "Day 4", percentage: 78 },
    { day: "Day 5", percentage: 88 },
  ];

  const averageMarks = 78;
  const totalDaysActive = 45;
  const totalAttempts = 10;
  const position = "3rd";

  const blueShade = "#1E90FF";




  return (
    <div
      style={{
        fontFamily: "'Poppins', sans-serif",
        minHeight: "100vh",
        backgroundColor: "#ffffff",
        transition: "all 0.3s",
      }}
    >
      {/* NAVBAR */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={true}
        navbarStyle={{
          backgroundColor: "#0A5F14",
          color: "white",
          boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
        }}
      />

      <div style={{ display: "flex" }}>
        {/* SIDEBAR */}
        <div
          style={{
            width: sidebarOpen ? "220px" : "40px",
            backgroundColor: "#ffffff",
            color: "#06400F",
            transition: "width 0.3s",
            padding: "20px 10px",
            display: "flex",
            flexDirection: "column",
            alignItems: sidebarOpen ? "flex-start" : "center",
            borderRight: "1px solid #ccc",
            minHeight: "calc(100vh - 60px)",
            boxShadow: "2px 0 6px rgba(0,0,0,0.1)",
          }}
        >
          <button
            onClick={toggleSidebar}
            style={{
              backgroundColor: sidebarOpen ? "#f4f4f4" : "#ffffff",
              color: "#06400F",
              border: "1px solid #ccc",
              padding: "8px",
              borderRadius: "5px",
              cursor: "pointer",
              marginBottom: "20px",
              width: sidebarOpen ? "100%" : "35px",
              transition: "all 0.3s",
              fontWeight: "bold",
            }}
          >
            {sidebarOpen ? "Close" : "≡"}
          </button>

          {sidebarOpen && (
            <div style={{ marginTop: "10px", fontSize: "14px", width: "100%" }}>
              <h4 style={{ marginBottom: "10px", color: "#0A5F14" }}>Profile</h4>
              <p><strong>Name:</strong> John Doe</p>
              <p><strong>Email:</strong> john.doe@example.com</p>
              <p><strong>Role:</strong> Student</p>
            </div>
          )}
        </div>

        {/* MAIN CONTENT */}
        <div style={{ flex: 1, padding: "30px", color: "#06400F" }}>
          <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
            <h2>Dashboard</h2>
            <button
              style={{
                backgroundColor: blueShade,
                color: "white",
                border: "none",
                padding: "10px 20px",
                borderRadius: "8px",
                cursor: "pointer",
                fontWeight: "bold",
                boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
                transition: "all 0.3s",
              }}
              onMouseEnter={(e) => (e.target.style.backgroundColor = "#1C86EE")}
              onMouseLeave={(e) => (e.target.style.backgroundColor = blueShade)}
            >
              Start Exam
            </button>
          </div>

          {/* 1️⃣ SUMMARY CARDS */}
          <div style={{ display: "flex", gap: "20px", marginTop: "20px" }}>
            {[ 
              { title: "Total Attempts", value: totalAttempts },
              { title: "Total Days Active", value: totalDaysActive },
              { title: "Position", value: position },
            ].map((card, idx) => (
              <div
                key={idx}
                style={{
                  flex: 1,
                  backgroundColor: blueShade,
                  padding: "20px",
                  borderRadius: "12px",
                  boxShadow: "0 4px 10px rgba(0,0,0,0.2)",
                  textAlign: "center",
                  color: "white",
                  cursor: "pointer",
                  transition: "all 0.3s",
                }}
                onMouseEnter={(e) => (e.currentTarget.style.transform = "translateY(-5px)")}
                onMouseLeave={(e) => (e.currentTarget.style.transform = "translateY(0)")}
              >
                <div style={{ fontSize: "18px", fontWeight: "bold" }}>{card.title}</div>
                <div style={{ fontSize: "28px", marginTop: "10px" }}>{card.value}</div>
              </div>
            ))}
          </div>

          {/* 2️⃣ PAST EXAM RECORDS */}
          <div
            style={{
              marginTop: "40px",
              padding: "20px",
              border: "1px solid #ccc",
              borderRadius: "12px",
              backgroundColor: "#f0f8ff",
            }}
          >
            <h3>Past Exam Records</h3>
            <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "10px" }}>
              <thead>
                <tr>
                  <th style={{ borderBottom: "1px solid #ccc", padding: "8px" }}>S.No</th>
                  <th style={{ borderBottom: "1px solid #ccc", padding: "8px" }}>Date</th>
                  <th style={{ borderBottom: "1px solid #ccc", padding: "8px" }}>Score</th>
                </tr>
              </thead>
              <tbody>
                {pastRecords.slice(recordPage * 5, recordPage * 5 + 5).map((record, idx) => (
                  <tr key={idx}>
                    <td style={{ textAlign: "center", padding: "8px" }}>{recordPage * 5 + idx + 1}</td>
                    <td style={{ textAlign: "center", padding: "8px" }}>{record.date}</td>
                    <td style={{ textAlign: "center", padding: "8px" }}>{record.score}</td>
                  </tr>
                ))}
              </tbody>
            </table>
            <div style={{ marginTop: "10px", display: "flex", justifyContent: "space-between" }}>
              <button
                onClick={() => setRecordPage((prev) => Math.max(prev - 1, 0))}
                disabled={recordPage === 0}
                style={{
                  padding: "6px 12px",
                  borderRadius: "6px",
                  border: "none",
                  backgroundColor: blueShade,
                  color: "white",
                  cursor: "pointer",
                }}
              >
                Back
              </button>
              <button
                onClick={() => setRecordPage((prev) => (prev + 1) * 5 < pastRecords.length ? prev + 1 : prev)}
                disabled={(recordPage + 1) * 5 >= pastRecords.length}
                style={{
                  padding: "6px 12px",
                  borderRadius: "6px",
                  border: "none",
                  backgroundColor: blueShade,
                  color: "white",
                  cursor: "pointer",
                }}
              >
                Next
              </button>
            </div>
          </div>

          {/* 3️⃣ PIE CHART */}
          <div
            style={{
              marginTop: "40px",
              display: "flex",
              gap: "30px",
              padding: "20px",
              border: "1px solid #ccc",
              borderRadius: "12px",
              backgroundColor: "#f0f8ff",
              alignItems: "center",
            }}
          >
            <div style={{ flex: 1, display: "flex", justifyContent: "center" }}>
              <div
                style={{
                  width: "200px",
                  height: "200px",
                  borderRadius: "50%",
                  background: `conic-gradient(${blueShade} 0% ${averageMarks}%, #ddd ${averageMarks}% 100%)`,
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                  fontSize: "24px",
                  fontWeight: "bold",
                  color: "#06400F",
                }}
              >
                {averageMarks}%
              </div>
            </div>
            <div style={{ flex: 2, fontSize: "16px" }}>
              This pie chart represents your <strong>average marks</strong> across all attempted exams.
            </div>
          </div>

          {/* 4️⃣ LAST 5 EXAMS PERFORMANCE */}
          <div
            style={{
              marginTop: "40px",
              padding: "20px",
              border: "1px solid #ccc",
              borderRadius: "12px",
              backgroundColor: "#f0f8ff",
            }}
          >
            <h3 style={{ marginBottom: "20px" }}>Last 5 Exams Performance</h3>
            <div style={{ display: "flex", gap: "10px" }}>
              <div
                style={{
                  display: "flex",
                  flexDirection: "column",
                  justifyContent: "space-between",
                  height: "160px",
                  fontSize: "12px",
                }}
              >
                {[100, 75, 50, 25, 0].map((val, idx) => (
                  <span key={idx}>{val}%</span>
                ))}
              </div>
              <div
                style={{
                  display: "flex",
                  flex: 1,
                  justifyContent: "space-between",
                  alignItems: "flex-end",
                  height: "160px",
                }}
              >
                {last5Exams.map((exam, idx) => (
                  <div key={idx} style={{ textAlign: "center", flex: 1 }}>
                    <div
                      style={{
                        height: `${exam.percentage * 1.5}px`,
                        width: "25px",
                        backgroundColor: blueShade,
                        borderRadius: "6px 6px 0 0",
                        position: "relative",
                      }}
                    >
                      <span
                        style={{
                          position: "absolute",
                          top: "-20px",
                          left: "50%",
                          transform: "translateX(-50%)",
                          fontSize: "12px",
                          fontWeight: "bold",
                        }}
                      >
                        {exam.percentage}%
                      </span>
                    </div>
                    <div style={{ marginTop: "10px", fontSize: "12px" }}>{exam.day}</div>
                  </div>
                ))}
              </div>
            </div>
          </div>

          {/* 5️⃣ LEADERBOARD */}
          <div
            style={{
              marginTop: "40px",
              padding: "20px",
              border: "1px solid #ccc",
              borderRadius: "12px",
              backgroundColor: "#f0f8ff",
            }}
          >
            <h3>Leaderboard (Top 5)</h3>
            <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "10px" }}>
              <thead>
                <tr>
                  <th style={{ borderBottom: "1px solid #ccc", padding: "8px" }}>Rank</th>
                  <th style={{ borderBottom: "1px solid #ccc", padding: "8px" }}>Name</th>
                  <th style={{ borderBottom: "1px solid #ccc", padding: "8px" }}>Score</th>
                </tr>
              </thead>
              <tbody>
                {leaderboard.map((item) => (
                  <tr key={item.rank}>
                    <td style={{ textAlign: "center", padding: "8px" }}>{item.rank}</td>
                    <td style={{ textAlign: "center", padding: "8px" }}>{item.name}</td>
                    <td style={{ textAlign: "center", padding: "8px" }}>{item.score}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default Dashboard;
